import React from 'react'

const Blog = ({ author, title, url }) => {
  console.log(author)
  return (
    <>
      <h1>Author :{author}</h1>
      <h2>Title :{title} </h2>
      <h3>Url :{url}</h3>

    </>
  )
}

export default Blog
